def setup_openai_client():
    """OpenAIGoogle Vertex AI"""
    PROJECT_ID = os.environ.get("GOOGLE_CLOUD_PROJECT", "veo-testing")
    LOCATION = os.environ.get("GOOGLE_CLOUD_REGION", "global")
    
    print(f": {PROJECT_ID}, : {LOCATION}")
    
    # 
    credentials, _ = default(scopes=["https://www.googleapis.com/auth/cloud-platform"])
    credentials.refresh(Request())
    # print(f"Credentials token : {credentials.token}")
    
    # API
    api_host = "aiplatform.googleapis.com"
    if LOCATION != "global":
        api_host = f"{LOCATION}-aiplatform.googleapis.com"
    
    # 
    client = openai.OpenAI(
        base_url=f"https://{api_host}/v1/projects/{PROJECT_ID}/locations/{LOCATION}/endpoints/openapi",
        api_key=credentials.token,
    )
    
    return client


@timing_decorator
def generate_with_openai(
  client: Any,
  messages: List[Any],
  max_tokens=10240,
  stream=False,
  model: str = "google/gemini-3-pro"):

    response = client.chat.completions.create(
        max_tokens=max_tokens,
        model=model,
        messages=messages,
        stream=stream,
    )

    return response


def main():

    max_tokens = 10240
    model = "google/gemini-3-pro-preview"
    

    client = setup_openai_client()

    # Non-Stream
    stream = False
    response = generate_with_openai(
      client=client,
      messages=messages,
      max_tokens=max_tokens,
      stream=stream,
      model=model)
    
    # print(response)
    print(f"Response content: {response.choices[0].message.content}")

    return response
        

